import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <p>
          <img src= "upside ground logo.jpg" alt ="logo" className ="logo"  />
        </p>
        <a
          className="homelink"
          href= "log in"
          target="_blank"
          rel="noopener noreferrer"
        >
         log in
        </a>
      </header>
    </div>
  );
}

export default App;
